import axios from "axios"
import { useEffect, useState } from "react";

export function Other(){
    const [friend,set_friend] = useState([]);
    useEffect(()=>{
        axios.get("http://127.0.0.1:8000/api/v1/Friends").then(data=>{
            set_friend(data.data);
        })
    },[]);
    return(
    <>
        <div>
            {friend.map(elem=>{
                return(
                <>
                <p>{elem.fr}</p>
                </>);
            })}
        </div>
    </>
    )
}
